import React, { Component } from "react";
import { VictoryChart, VictoryBar, VictoryTheme } from "victory";

export default class PieChart extends Component {
  render() {
    return (
      <VictoryChart theme={VictoryTheme.material}>
        <VictoryBar
          alignment="start"
          data={this.props.data}
          x="label"
          y="names"
        />
      </VictoryChart>
    );
  }
}
